tables.table_schema:
CREATE TABLE ErrorCorrectionData (
    id SERIAL PRIMARY KEY,
    error_code INT NOT NULL,
    error_description VARCHAR(255) NOT NULL,
    correction_method VARCHAR(100) NOT NULL
);

CREATE TABLE ErrorOccurrence (
    error_id INT,
    error_timestamp TIMESTAMP NOT NULL,
    error_location VARCHAR(50) NOT NULL,
    severity INT NOT NULL
);

CREATE TABLE CorrectionAnalysis (
    id SERIAL PRIMARY KEY,
    error_id INT NOT NULL,
    analysis_date DATE NOT NULL,
    correction_success BOOLEAN NOT NULL
);

CREATE TABLE ErrorEvents (
  event_id UUID PRIMARY KEY,
  event_timestamp TIMESTAMP,
  error_type TEXT,
  correction_method TEXT
);

CREATE TABLE QuantumCircuits (
  circuit_id UUID PRIMARY KEY,
  circuit_name TEXT,
  gate_operations JSONB
);

CREATE TABLE CorrectionLog (
  log_id UUID PRIMARY KEY,
  event_id UUID,
  correction_timestamp TIMESTAMP,
  correction_success BOOLEAN
);

CREATE TABLE detector_info (
    detector_id INT PRIMARY KEY,
    detector_name TEXT,
    detector_location TEXT
);
